import React, { useState, useEffect } from 'react';
import { Bar } from "react-chartjs-2";
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from "chart.js";

ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);
export default function App() {
  const [frames, setFrames] = useState(3);
  const [referenceString, setReferenceString] = useState('7, 0, 1, 2, 0, 3, 0, 4, 2, 3, 0, 3');
  const [algorithm, setAlgorithm] = useState('FIFO');
  const [result, setResult] = useState(null);

  const parseRefs = () => referenceString.split(/[ ,]+/).map(Number).filter(x => !isNaN(x));

  const simulate = () => {
    const refs = parseRefs();
    const n = frames;
    const mem = [];
    const pages = [];
    let hits = 0, misses = 0;

    if (algorithm === 'FIFO') {
      const queue = [];
      for (const page of refs) {
        if (mem.includes(page)) {
          hits++;
        } else {
          misses++;
          if (mem.length < n) mem.push(page);
          else mem[mem.indexOf(queue.shift())] = page;
          queue.push(page);
        }
        pages.push([...mem]);
      }
    } else if (algorithm === 'LRU') {
      const stack = [];
      for (const page of refs) {
        if (mem.includes(page)) {
          hits++;
          stack.splice(stack.indexOf(page), 1);
        } else {
          misses++;
          if (mem.length < n) mem.push(page);
          else {
            const lru = stack.shift();
            mem[mem.indexOf(lru)] = page;
          }
        }
        stack.push(page);
        pages.push([...mem]);
      }
    }

    const total = hits + misses;
    const hitRatio = ((hits / total) * 100).toFixed(2);
    const missRatio = ((misses / total) * 100).toFixed(2);

    setResult({ pages, hits, misses, hitRatio, missRatio });
  };

  return (
    <div style={{ fontFamily: 'Arial', padding: '20px', maxWidth: '800px', margin: 'auto' }}>
      <h1>Paging Simulator</h1>
      <div style={{ marginBottom: '15px' }}>
        <label>Frames: </label>
        <input type="number" value={frames} onChange={e => setFrames(parseInt(e.target.value))} min="1" />
        <br />
        <label>Reference String: </label>
        <input style={{ width: '100%' }} value={referenceString} onChange={e => setReferenceString(e.target.value)} />
        <br />
        <label>Algorithm: </label>
        <select value={algorithm} onChange={e => setAlgorithm(e.target.value)}>
          <option value="FIFO">FIFO</option>
          <option value="LRU">LRU</option>
        </select>
        <br />
        <button onClick={simulate}>Run Simulation</button>
      </div>

      {result && (
        <div>
          <h2>Results</h2>
          <p><strong>Total Hits:</strong> {result.hits} | <strong>Total Misses:</strong> {result.misses}</p>
          <p><strong>Hit Ratio:</strong> {result.hitRatio}% | <strong>Miss Ratio:</strong> {result.missRatio}%</p>

          <div style={{ display: 'flex', alignItems: 'flex-end', height: '200px', gap: '10px', marginTop: '20px' }}>
            <div style={{ backgroundColor: 'green', width: '100px', height: `${result.hitRatio * 2}px`, textAlign: 'center', color: 'white' }}>
              {result.hitRatio}%
              <div>Hits</div>
            </div>
            <div style={{ backgroundColor: 'red', width: '100px', height: `${result.missRatio * 2}px`, textAlign: 'center', color: 'white' }}>
              {result.missRatio}%
              <div>Misses</div>
            </div>
          </div>

          <h3>Frame Allocation Steps</h3>
          <table border="1" cellPadding="5">
            <thead>
              <tr><th>Step</th><th>Memory Frames</th></tr>
            </thead>
            <tbody>
              {result.pages.map((state, i) => (
                <tr key={i}>
                  <td>{i + 1}</td>
                  <td>{state.join(', ')}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}
